import{_ as n,V as r,W as d,X as e,$ as t,Y as a,a0 as s,z as c}from"./framework.8f854aa5.js";const p={},i={id:"_12-integer-to-roman",tabindex:"-1"},l=e("a",{class:"header-anchor",href:"#_12-integer-to-roman","aria-hidden":"true"},"#",-1),u={href:"https://leetcode.com/problems/integer-to-roman/",target:"_blank",rel:"noopener noreferrer"},m=s('<p>Roman numerals are represented by seven different symbols: <code>I</code>, <code>V</code>, <code>X</code>, <code>L</code>, <code>C</code>, <code>D</code> and <code>M</code>.</p><table><thead><tr><th>Symbol</th><th>Value</th></tr></thead><tbody><tr><td>I</td><td>1</td></tr><tr><td>V</td><td>5</td></tr><tr><td>X</td><td>10</td></tr><tr><td>L</td><td>50</td></tr><tr><td>C</td><td>100</td></tr><tr><td>D</td><td>500</td></tr><tr><td>M</td><td>1000</td></tr></tbody></table><p>For example, <code>2</code> is written as <code>II</code> in Roman numeral, just two one&#39;s added together. <code>12</code> is written as <code>XII</code>, which is simply <code>X + II</code>. The number <code>27</code> is written as <code>XXVII</code>, which is <code>XX + V + II</code>.</p><p>Roman numerals are usually written largest to smallest from left to right. However, the numeral for four is not <code>IIII</code>. Instead, the number four is written as <code>IV</code>. Because the one is before the five we subtract it making four. The same principle applies to the number nine, which is written as <code>IX</code>. There are six instances where subtraction is used:</p><ul><li><code>I</code> can be placed before <code>V</code> (5) and <code>X</code> (10) to make 4 and 9.</li><li><code>X</code> can be placed before <code>L</code> (50) and <code>C</code> (100) to make 40 and 90.</li><li><code>C</code> can be placed before <code>D</code> (500) and <code>M</code> (1000) to make 400 and 900.</li></ul><p>Given an integer, convert it to a roman numeral.</p><p><strong>Example 1:</strong></p><p><strong>Input:</strong> num = 3</p><p><strong>Output:</strong> &quot;III&quot;</p><p><strong>Example 2:</strong></p><p><strong>Input:</strong> num = 4</p><p><strong>Output:</strong> &quot;IV&quot;</p><p><strong>Example 3:</strong></p><p><strong>Input:</strong> num = 9</p><p><strong>Output:</strong> &quot;IX&quot;</p><p><strong>Example 4:</strong></p><p><strong>Input:</strong> num = 58</p><p><strong>Output:</strong> &quot;LVIII&quot;</p><p><strong>Explanation:</strong> L = 50, V = 5, III = 3.</p><p><strong>Example 5:</strong></p><p><strong>Input:</strong> num = 1994</p><p><strong>Output:</strong> &quot;MCMXCIV&quot;</p><p><strong>Explanation:</strong> M = 1000, CM = 900, XC = 90 and IV = 4.</p><h2 id="constraints" tabindex="-1"><a class="header-anchor" href="#constraints" aria-hidden="true">#</a> Constraints</h2><ul><li><code>1 &lt;= num &lt;= 3999</code></li></ul>',25);function g(h,I){const o=c("ExternalLinkIcon");return r(),d("div",null,[e("h1",i,[l,t(),e("a",u,[t("12. Integer to Roman"),a(o)])]),m])}const f=n(p,[["render",g],["__file","index.html.vue"]]);export{f as default};
